import back from "../../components/Botton/back.vue";
import { apiGetChallengeMatchItemList } from "@/api/match";
export default {
  components: {
    back: back
  },
  created: function created() {
    this.lang = JSON.parse(localStorage.getItem("lang")).tag;
    this.getMatchItemList();
  },
  data: function data() {
    return {
      match: "",
      lang: "",
      isLoading: false,
      isNoData: false
    };
  },
  methods: {
    getMatchItemList: function getMatchItemList() {
      var _this = this;

      this.isLoading = true;
      var data = {
        challengeId: this.$store.state.match.ChallengeId
      };
      apiGetChallengeMatchItemList(data, true).then(function (res) {
        console.log(res.length);

        if (res.length > 0) {
          _this.match = res;
          _this.isNoData = false;
          _this.isLoading = false;
        } else {
          console.log('dasds');
          _this.isLoading = false;
          _this.isNoData = true;
        }
      });
    }
  }
};
